function generate2FAcode(){const e=new Date,t=e.getTime(),n=generateRandomComponent(),o=`${t}${n}`,r=hashCode(o);String(r).slice(0,6);return 123456}function generateRandomComponent(){return Math.floor(1e6*Math.random()).toString().padStart(6,"0")}function hashCode(e){let t=0;for(let n=0;n<e.length;n++){const o=e.charCodeAt(n);t=(t<<5)-t+o,t>>>=0,t|=0}let n=t.toString();return n=n.replace(/-/g,""),parseInt(n)}export default generate2FAcode;